            categories: [
                {
                    categoryID:1,
                    categoryName: "Beverage"
                },
                {
                    categoryID:2,
                    categoryName: "Futires"
                },
                {
                    categoryID:3,
                    categoryName: "Foods"
                },

            ]
        }
    }
    render() {
        return (
            <div className="category">
                <h3>{this.props.info.title}</h3>
                {
                    console.log(this.state.categories)
                }
